import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'insistent-test-project';
}
<!-- Since its a small project, so I am not focusing on component wise building! -->

<img class="left-col-img" src="../assets/images/left-col.png" alt="left-col">

<router-outlet></router-outlet>
